import blob1 from './images/blob1.svg';
import blob2 from './images/blob2.png';

function Background() {
	return (
		<div className="Background">
			<img src={blob1} alt="" className="TopRight" />
			<img src={blob2} alt="" className="BottomLeft" />
		</div>
	)
}

export default Background;
